class SegmentTree(val arr: Array<Int>) {
    private val n = arr.size
    private val seg = Array(4 * n) { 0 }

    init {
        build(arr, 1, 0, n - 1)
    }

    private fun build(arr: Array<Int>, node: Int, left: Int, right: Int) {
        if (left == right) {
            seg[node] = arr[left]
            return
        }
        val mid = (left + right) / 2
        build(arr, 2 * node, left, mid)
        build(arr, 2 * node + 1, mid + 1, right)
        seg[node] = seg[2 * node] + seg[2 * node + 1]
    }

    fun getSum(left: Int, right: Int): Int {
        return getSum(1, 0, n - 1, left, right)
    }

    private fun getSum(node: Int, left: Int, right: Int, qleft: Int, qright: Int): Int {
        if (qleft <= left && qright >= right) {
            return seg[node]
        }
        val mid = (left + right) / 2
        var sum = 0
        if (qleft <= mid) sum += getSum(2 * node, left, mid, qleft, qright)
        if (qright > mid) sum += getSum(2 * node + 1, mid + 1, right, qleft, qright)
        return sum
    }
}

