class CyclicRotation {
    fun solution(a: IntArray, k: Int): IntArray {
        if (a.isEmpty()) return intArrayOf()
        if (a.size == 1) return a
        if (k == 0) return a
        if (k % a.size == 0) return a
        val k1 = k % a.size
        val result = IntArray(a.size)
        val queue = ArrayDeque<Int>()
        queue.addAll(a.toList())
        var i = 0
        while (i < a.size) {
            result[i] = queue.removeLast()
            queue.addFirst(result[i])
            i++
        }
        return result.sliceArray(0 until k1) + result.sliceArray(k1 until a.size)
    }
}

