fun quickSort(arr: IntArray, left: Int, right: Int) {
    if (left < right) {
        val pivot = partition(arr, left, right)
        quickSort(arr, left, pivot - 1)
        quickSort(arr, pivot + 1, right)
    }
}

fun partition(arr: IntArray, left: Int, right: Int): Int {
    val pivot = arr[left]
    var i = left
    var j = right
    while (i < j) {
        while (arr[i] < pivot) {
            i++
        }
        while (arr[j] > pivot) {
            j--
        }
        if (i < j) {
            val temp = arr[i]
            arr[i] = arr[j]
            arr[j] = temp
        }
    }
    arr[left] = arr[j]
    arr[j] = pivot
    return j
}

