                break;
            }
            int tmp = array[i];
            array[i] = array[j];
            array[j] = tmp;
            i++;
            j--;
        }
        array[left] = array[j];
        array[j] = pivot;
        return j;
    }

    private static final void quickSort$inner(int[] array, int left, int right) {
        if (left >= right) {
            return;
        }
        int pivot = quickSort$partition(array, left, right);
        quickSort$inner(array, left, pivot - 1);
        quickSort$inner(array, pivot + 1, right);
    }
}

