class SolutionLCP13 {
    fun minimalSteps(board: Array<String>): Int {
        var steps = 0
        val n = board.size
        val m = board[0].length
        val visited = Array(n) { BooleanArray(m) }
        val queue = ArrayDeque<Pair<Int, Int>>()
        queue.add(Pair(0, 0))
        visited[0][0] = true
        while (queue.isNotEmpty()) {
            val (i, j) = queue.removeFirst()
            if (i == n - 1 && j == m - 1) {
                break
            }
            for (k in 0..3) {
                val ni = i + dir[k][0]
                val nj = j + dir[k][1]
                if (ni in 0 until n && nj in 0 until m && !visited[ni][nj]) {
                    if (board[ni][nj] == 'S') {
                        queue.add(Pair(ni, nj))
                        visited[ni][nj] = true
                    } else if (board[ni][nj] == 'T') {
                        steps++
                        visited[ni][nj] = true
                    }
                }
            }
        }
        return steps
    }

    companion object {
        val dir = arrayOf(intArrayOf(0, 1), intArrayOf(1, 0), intArrayOf(0, -1), intArrayOf(-1, 0))
    }
}

